import React, { Component } from 'react'
import { Link, animateScroll as scroll } from "react-scroll";
import styled from 'styled-components';
import {
    MDBNavbar,
    MDBNavbarBrand,
    MDBNavbarNav,
    MDBNavItem,
    MDBNavLink,
    MDBNavbarToggler,
    MDBCollapse,
    MDBBtn,
    MDBContainer,
  } from "mdbreact";
  import './NavbarPage.css';
export default class NavbarPage extends Component {
    // state = {
